import React, { useState } from 'react';
import { Upload, File, AlertCircle, CheckCircle, Brain, BarChart3 } from 'lucide-react';

interface UploadResult {
  document_id: string;
  status: string;
  analysis: any;
  metadata: any;
}

const DocumentUploader: React.FC = () => {
  const [selectedFile, setSelectedFile] = useState<File | null>(null);
  const [uploading, setUploading] = useState(false);
  const [result, setResult] = useState<UploadResult | null>(null);
  const [error, setError] = useState<string | null>(null);

  const handleFileSelect = (event: React.ChangeEvent<HTMLInputElement>) => {
    const file = event.target.files?.[0];
    if (file) {
      setSelectedFile(file);
      setResult(null);
      setError(null);
    }
  };

  const handleUpload = async () => {
    if (!selectedFile) return;

    setUploading(true);
    setError(null);

    const formData = new FormData();
    formData.append('file', selectedFile);
    formData.append('analysis_type', 'full');

    try {
      const response = await fetch('http://localhost:8000/upload-document', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`Upload failed: ${response.statusText}`);
      }

      const result = await response.json();
      setResult(result);
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Upload failed');
    } finally {
      setUploading(false);
    }
  };

  const getSupportedFormats = () => [
    'PDF (.pdf)', 'Word (.doc, .docx)', 'Text (.txt)',
    'Images (.jpg, .png, .tiff) for OCR'
  ];

  const getRiskColor = (level: string) => {
    switch (level?.toLowerCase()) {
      case 'high': return 'text-red-600 bg-red-100';
      case 'medium': return 'text-yellow-600 bg-yellow-100';
      case 'low': return 'text-green-600 bg-green-100';
      default: return 'text-gray-600 bg-gray-100';
    }
  };

  return (
    <div className="max-w-6xl mx-auto p-6">
      <div className="bg-white rounded-lg shadow-lg p-8">
        <div className="text-center mb-8">
          <Brain className="h-16 w-16 text-blue-600 mx-auto mb-4" />
          <h1 className="text-3xl font-bold text-gray-900 mb-2">
            Intelligence Document Analyzer
          </h1>
          <p className="text-gray-600">
            Upload documents for comprehensive intelligence analysis with AI-powered extraction
          </p>
        </div>

        {/* File Upload Section */}
        <div className="mb-8">
          <div className="border-2 border-dashed border-gray-300 rounded-lg p-8 text-center hover:border-blue-400 transition-colors">
            <Upload className="h-12 w-12 text-gray-400 mx-auto mb-4" />
            <div className="space-y-2">
              <p className="text-lg font-medium text-gray-900">
                Drop your intelligence document here
              </p>
              <p className="text-gray-500">or click to browse</p>
            </div>
            <input
              type="file"
              accept=".pdf,.doc,.docx,.txt,.jpg,.jpeg,.png,.tiff,.bmp"
              onChange={handleFileSelect}
              className="hidden"
              id="file-upload"
            />
            <label
              htmlFor="file-upload"
              className="mt-4 inline-flex items-center px-6 py-3 border border-transparent text-base font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 cursor-pointer transition-colors"
            >
              Choose Document
            </label>
          </div>

          {/* Supported Formats */}
          <div className="mt-4">
            <p className="text-sm font-medium text-gray-700 mb-2">Supported formats:</p>
            <div className="flex flex-wrap gap-2">
              {getSupportedFormats().map((format, index) => (
                <span
                  key={index}
                  className="px-3 py-1 bg-blue-100 text-blue-800 text-sm rounded-full"
                >
                  {format}
                </span>
              ))}
            </div>
          </div>
        </div>

        {/* Selected File */}
        {selectedFile && (
          <div className="mb-6 p-4 bg-gray-50 rounded-lg">
            <div className="flex items-center justify-between">
              <div className="flex items-center space-x-3">
                <File className="h-8 w-8 text-blue-600" />
                <div>
                  <p className="font-medium text-gray-900">{selectedFile.name}</p>
                  <p className="text-sm text-gray-500">
                    {(selectedFile.size / 1024 / 1024).toFixed(2)} MB
                  </p>
                </div>
              </div>
              <button
                onClick={handleUpload}
                disabled={uploading}
                className="px-6 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 disabled:opacity-50 disabled:cursor-not-allowed transition-colors flex items-center space-x-2"
              >
                <BarChart3 className="h-4 w-4" />
                <span>{uploading ? 'Processing...' : 'Analyze Document'}</span>
              </button>
            </div>
          </div>
        )}

        {/* Processing Status */}
        {uploading && (
          <div className="mb-6 p-4 bg-blue-50 border border-blue-200 rounded-lg">
            <div className="flex items-center space-x-3">
              <div className="animate-spin rounded-full h-6 w-6 border-b-2 border-blue-600"></div>
              <p className="text-blue-800">Processing document... This may take a few moments for OCR and analysis.</p>
            </div>
          </div>
        )}

        {/* Error Display */}
        {error && (
          <div className="mb-6 p-4 bg-red-50 border border-red-200 rounded-lg">
            <div className="flex items-center space-x-3">
              <AlertCircle className="h-6 w-6 text-red-600" />
              <p className="text-red-800">{error}</p>
            </div>
          </div>
        )}

        {/* Results Display */}
        {result && (
          <div className="space-y-6">
            <div className="p-4 bg-green-50 border border-green-200 rounded-lg">
              <div className="flex items-center space-x-3">
                <CheckCircle className="h-6 w-6 text-green-600" />
                <p className="text-green-800 font-medium">Document processed successfully!</p>
              </div>
            </div>

            {/* Intelligence Summary */}
            <div className="bg-gradient-to-r from-blue-50 to-indigo-50 rounded-lg p-6 border border-blue-200">
              <h3 className="text-lg font-semibold text-gray-900 mb-4 flex items-center">
                <Brain className="h-5 w-5 text-blue-600 mr-2" />
                Intelligence Summary
              </h3>
              <p className="text-gray-700 mb-4 text-lg">{result.analysis.intelligence_summary}</p>

              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
                <div className="bg-white p-4 rounded-lg border shadow-sm">
                  <p className="text-sm text-gray-600">Confidence Score</p>
                  <p className="text-2xl font-bold text-blue-600">
                    {(result.analysis.confidence_score * 100).toFixed(0)}%
                  </p>
                </div>
                <div className="bg-white p-4 rounded-lg border shadow-sm">
                  <p className="text-sm text-gray-600">Document Type</p>
                  <p className="text-lg font-semibold text-gray-900">
                    {result.analysis.document_classification.primary_type.replace('_', ' ').toUpperCase()}
                  </p>
                </div>
                <div className="bg-white p-4 rounded-lg border shadow-sm">
                  <p className="text-sm text-gray-600">Locations Found</p>
                  <p className="text-2xl font-bold text-green-600">
                    {result.analysis.geographic_intelligence.total_locations}
                  </p>
                </div>
                <div className="bg-white p-4 rounded-lg border shadow-sm">
                  <p className="text-sm text-gray-600">Threat Level</p>
                  <p className={`text-lg font-semibold px-2 py-1 rounded ${getRiskColor(result.analysis.sentiment_analysis.threat_level)}`}>
                    {result.analysis.sentiment_analysis.threat_level}
                  </p>
                </div>
              </div>
            </div>

            {/* Detailed Analysis */}
            <div className="bg-white border rounded-lg p-6">
              <h3 className="text-lg font-semibold text-gray-900 mb-4">Detailed Analysis</h3>

              {/* Numerical Intelligence */}
              {Object.keys(result.analysis.numerical_intelligence).some(key =>
                result.analysis.numerical_intelligence[key].length > 0
              ) && (
                <div className="mb-6">
                  <h4 className="font-medium text-gray-900 mb-3 flex items-center">
                    <BarChart3 className="h-4 w-4 text-blue-600 mr-2" />
                    Numerical Intelligence
                  </h4>
                  <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
                    {Object.entries(result.analysis.numerical_intelligence).map(([key, values]: [string, any[]]) => (
                      values.length > 0 && (
                        <div key={key} className="bg-gray-50 p-3 rounded border">
                          <p className="text-sm font-medium text-gray-700 capitalize">
                            {key.replace('_', ' ')}
                          </p>
                          <p className="text-lg font-bold text-blue-600">
                            {Math.max(...values)}
                          </p>
                          {values.length > 1 && (
                            <p className="text-xs text-gray-500">
                              {values.length} references found
                            </p>
                          )}
                        </div>
                      )
                    ))}
                  </div>
                </div>
              )}

              {/* Geographic Intelligence */}
              {result.analysis.geographic_intelligence.states.length > 0 && (
                <div className="mb-6">
                  <h4 className="font-medium text-gray-900 mb-3">Affected Locations</h4>
                  <div className="flex flex-wrap gap-2">
                    {result.analysis.geographic_intelligence.states.map((state: string, index: number) => (
                      <span key={index} className="px-3 py-1 bg-red-100 text-red-800 rounded-full text-sm font-medium">
                        📍 {state}
                      </span>
                    ))}
                  </div>
                </div>
              )}

              {/* Crime Patterns */}
              {Object.keys(result.analysis.crime_patterns.crime_frequencies).length > 0 && (
                <div className="mb-6">
                  <h4 className="font-medium text-gray-900 mb-3">Crime Patterns</h4>
                  <div className="space-y-2">
                    {Object.entries(result.analysis.crime_patterns.crime_frequencies).map(([crime, count]: [string, any]) => (
                      <div key={crime} className="flex justify-between items-center p-3 bg-gray-50 rounded border">
                        <span className="capitalize font-medium">{crime.replace('_', ' ')}</span>
                        <span className="bg-blue-100 text-blue-800 px-2 py-1 rounded text-sm font-semibold">
                          {count} mentions
                        </span>
                      </div>
                    ))}
                  </div>
                </div>
              )}

              {/* Document Metadata */}
              <div className="mb-6">
                <h4 className="font-medium text-gray-900 mb-3">Document Metadata</h4>
                <div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-sm">
                  <div>
                    <p className="text-gray-600">Security Level</p>
                    <p className="font-semibold">{result.analysis.document_classification.security_classification}</p>
                  </div>
                  <div>
                    <p className="text-gray-600">Word Count</p>
                    <p className="font-semibold">{result.analysis.text_statistics.word_count.toLocaleString()}</p>
                  </div>
                  <div>
                    <p className="text-gray-600">Sentences</p>
                    <p className="font-semibold">{result.analysis.text_statistics.sentence_count}</p>
                  </div>
                  <div>
                    <p className="text-gray-600">File Type</p>
                    <p className="font-semibold uppercase">{result.metadata.file_type}</p>
                  </div>
                </div>
              </div>

              {/* Temporal Intelligence */}
              {(result.analysis.temporal_intelligence.months_mentioned.length > 0 ||
                result.analysis.temporal_intelligence.years_mentioned.length > 0) && (
                <div className="mb-6">
                  <h4 className="font-medium text-gray-900 mb-3">Temporal References</h4>
                  <div className="flex flex-wrap gap-2">
                    {result.analysis.temporal_intelligence.months_mentioned.map((month: string, index: number) => (
                      <span key={`month-${index}`} className="px-2 py-1 bg-green-100 text-green-800 rounded text-sm">
                        📅 {month}
                      </span>
                    ))}
                    {result.analysis.temporal_intelligence.years_mentioned.map((year: string, index: number) => (
                      <span key={`year-${index}`} className="px-2 py-1 bg-blue-100 text-blue-800 rounded text-sm">
                        🗓️ {year}
                      </span>
                    ))}
                  </div>
                </div>
              )}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default DocumentUploader;
